import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

import Home from './components/pages/Home';
import About from './components/pages/About';
import NotFound from './components/pages/NotFound';
import Navbar from './components/layout/Navbar';
import Alert from './components/layout/Alert';
import GoalItem from './components/goals/GoalItem';
import GoalForm from './components/goals/GoalForm';
import Register from './components/auth/Register';
import Login from './components/auth/Login';
import GoalState from './contexts/goals/goalState';
import AuthState from './contexts/auth/authState';
import AlertState from './contexts/alerts/alertState';
// import CompetitionState from './contexts/competitions/competitionState';
import setAuthToken from './utils/setAuthToken';
// import PrivateRoute from './components/routing/PrivateRoute';

import './App.css';

if (localStorage.token) {
  setAuthToken(localStorage.token);
}

const App = () => {
  //Make routes private
  return (
    <AuthState>
      <AlertState>
        <GoalState>
          <Router>
            <React.Fragment>
              <Navbar />
              <div className="container">
                <Alert />
                <Switch>
                  <Route exact path='/register' component={Register} />
                  <Route exact path='/login' component={Login} />
                  <Route exact path='/' component={Home}/>
                  <Route exact path='/newgoal' component={GoalForm}/>
                  <Route exact path='/about' component={About}/>
                  <Route exact path='/goal/:id' component={GoalPage}/>
                  <Route component={NotFound}/>
                </Switch>
              </div>
            </React.Fragment>
          </Router>
        </GoalState>
      </AlertState>
    </AuthState>
  );
}

export default App;
